import ReactDOM from 'react-dom';
import React from 'react';
import {Button,Icon} from 'semantic-ui-react'

const addButton = () => {

    const addMovie = 
        <Button style={{position:'absolute',zIndex:"999", backgroundColor:"transparent",bottom:'0',left:'0'}} circular icon>
                <Icon circular name='plus' inverted color='orange'/>
        </Button> ;       


    ReactDOM.render(addMovie,document.getElementById(this.props.data.id + '_add'));

}

export default addButton;
